import {atom} from "recoil";

export const countryListState = atom({
  key: 'countryListState',
  default: [
    {code: "KR", name: "한국"},
    {code: "JP", name: "일본"},
    {code: "US", name: "미국"},
    {code: "HK", name: "홍콩"},
    {code: "GB", name: "영국"},
    {code: "FR", name: "프랑스"},
    {code: "ETC", name: "기타"},
  ],
});
